import React from "react";
import './Start.css';
import {Link } from "react-router-dom";

    function StartPage() {

        return (
          <div className="StartPage">
           <header className="Start-header">
            <p>
              <div>
               MEMORY GAME
              </div>
              <br />
              <br />
              Click on the button below to go back to the home page.
            </p>
            <Link to="/"><button>
              Restart
            </button>
            </Link>
           </header>
          </div>
        );

    }

export default StartPage;
